import React ,{useState,memo,useEffect} from 'react'



import axios from 'axios';
import useSWR from 'swr';



const Home = memo(()=>{
  const [newData,changeData]=useState<any[]>([]);
    const CLIENT_ID = '0Z-LBq4hNinGRglNGQpYef33VyodRl1K012Ai9dJd18';
    const URL = `https://api.unsplash.com/photos?page=1&per_page=10&client_id=${CLIENT_ID}`

    const {data} = useSWR(URL,(url:string)=>axios(url).then(res=>res.data));
    useEffect(()=>{
       changeData(data)
        },[data]) 
return(
<>
<h1>
{newData[0].urls.regular}
</h1>
</>
);
})
export default Home;
